import { Nav } from "react-bootstrap"
import MyStyle from '../../styles/colorStyle';
const Sidebar = () => (
    <div>
        <Nav defaultActiveKey="/home" className="flex-column" style={MyStyle.col_border}>
            <div className="hover"><Nav.Link style={MyStyle.col_border} href="/home">Active</Nav.Link></div>
            <div className="hover"><Nav.Link style={MyStyle.col_border} eventKey="link-1">Link</Nav.Link></div>
            <div className="hover"><Nav.Link style={MyStyle.col_border} eventKey="link-2">Link></Nav.Link></div>
            <div className="hover"><Nav.Link style={MyStyle.col_border} eventKey="link-3">Disabled</Nav.Link></div>
        </Nav>
        <style jsx>
            {`
                .hover:hover {
                    MyStyle.col_background;
                }
            `}
        </style>
    </div>
)

export default Sidebar;
